style.css:
@-moz-document url-prefix("https://telex.hu") {
html, body, body.index-page {
    background-color: #272822;
    color: #dfdfdf;
}

.article_title, .article_date, .cover_image_text, .article_tags a {
    color: #cfcfff;
}

.article_cat,
.single-article .article-html-content figure.image figcaption, .single-article .ck figure.image figcaption
{
    background-color: #474842;
    color: #dfdfdf;
}

nav.nav, .social-icon-wrapper {
    background-color: #c7c8c2;   
}
}
